    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <style type="text/css">:root {
--xe-scribble--pen-color: #FF0000;
--xe-scribble--button-draw-active-bg: #FF0000;
--xe-scribble--button-draw-active-fg: #FFFFFF;
--xe-scribble--button-active-color: #000000;
--xe-scribble--button-inactive-color: #666666;
}
.xe-scribble__cursor__eraser {
position: absolute;
height: 10px;
width: 10px;
border-radius: 50%;
pointer-events: none;
z-index: 5;
}
.xe-scribble__cursor__eraser.hidden {
display: none;
}
.xe-scribble {
position: absolute;
top: 0px;
left: 0px;
}
.xe-scribble__canvas__drawing,
.xe-scribble__canvas,
.xe-scribble {
pointer-events: none;
z-index: 1;
}
.xe-scribble__canvas__drawing.active {
pointer-events: all;
}
.xe-scribble__tools {
position: absolute;
top: 10px;
right: 10px;
pointer-events: all;
z-index: 101;
width: 32px;
}
.xe-scribble__button {
cursor: pointer;
padding: 3px;
background: unset;
border: unset;
border-radius: 100%;
width: 100%;
height: calc(100% - 3px);
margin-bottom: 5px;
opacity: 1;
transition: transform ease-out 100ms, opacity ease-out 80ms;
}
.xe-scribble__button:hover {
background-color: #eee;
}
.xe-scribble__button.active {
background-color: #4443;
}
.xe-scribble__tools.minimized > :nth-child(2) {
opacity: 0;
transform: translateY(-100%);
transition: ease-in 100ms, opacity ease-in 80ms;
z-index: 0;
pointer-events: none;
}
.xe-scribble__tools.minimized > :nth-child(3) {
opacity: 0;
transform: translateY(-200%);
transition: ease-in 100ms, opacity ease-in 80ms;
z-index: 0;
pointer-events: none;
}
.xe-scribble__tools.minimized > :nth-child(4) {
opacity: 0;
transform: translateY(-300%);
transition: ease-in 100ms, opacity ease-in 80ms;
z-index: 0;
pointer-events: none;
}
.xe-scribble__button > svg {
width: 100%;
height: 100%;
}
.xe-scribble__button__draw,
.xe-scribble__button__erase,
.xe-scribble__button__clear {
color: var(--xe-scribble--button-inactive-color);
}
.xe-scribble__button__draw:hover,
.xe-scribble__button__erase:hover,
.xe-scribble__button__clear:hover {
color: var(--xe-scribble--button-active-color);
}
.xe-scribble__button__draw.active {
color: var(--xe-scribble--button-draw-active-fg);
background-color: var(--xe-scribble--button-draw-active-bg);
}
.xe-scribble__button__erase.active > svg,
.xe-scribble__button__clear:hover > svg {
color: var(--xe-scribble--button-active-color);
}
#xe-scribble__colorPicker {
border-radius: 100%;
height: 30px;
width: 30px;
margin: 0;
border: none;
outline: none;
-webkit-appearance: none;
}
#xe-scribble__colorPicker::-webkit-color-swatch-wrapper {
padding: 0;
}
#xe-scribble__colorPicker::-webkit-color-swatch {
border-radius: 100%;
}
#xe-scribble__colorPicker::-moz-color-swatch{
border: none;
border-radius: 100%;
}

@media print {
.xe-scribble__tools {
display: none;
}
}
</style>
    <script>/*
 *  Scribble for remark.js/xaringan
 *  Matthew T. Warkentin <warkentin@lunenfeld.ca>
 *  and Garrick Aden-Buie <garrick@adenbuie.com>
 */

/* global slideshow,fabric */

class Scribble {
  constructor (opts) {
    // User options
    this.opts = opts
    this.penColors = opts.pen_color || '#FF0000'
    this.currColor = this.penColors[0]
    this.penSize = opts.pen_size || 3
    this.eraserSize = opts.eraser_size || this.penSize * 10
    this.tolerance = this.eraserSize / 2
    // this.eraserColor = opts['eraser_color'] || 'rgba(0, 0, 0, 0.1)'
    this.transparent = 'rgba(0, 0, 0, 0)'
    this.opts.palette = [
      ...this.opts.palette,
      ...this.defaultPresetColors.slice(this.opts.palette.length)
    ]

    // Fabric objects
    this.fabrics = null
    this.currFabric = null
    this.pathCache = []
    this.undo = this.undo.bind(this)
    this.redo = this.redo.bind(this)

    // State objects
    this.mouseDown = false
    this.drawMode = false
    this.eraseMode = false
    this.hideToolbox = true

    this.eraserCursorMovement = this.eraserCursorMovement.bind(this)
    this.eraserDetectErase = this.eraserDetectErase.bind(this)
    this.setPresetColor = this.setPresetColor.bind(this)

    // Toolbox objects
    this.launchKey = 83 // "S" used to toggle toolbox/state
    this.toolBox = null
    this.drawBtn = null
    this.eraseBtn = null
    this.clearBtn = null
    this.colorPicker = null
    this.eraserCursor = null

    // Scribble initialization
    this.setPenColorCSSVariables(this.currColor)
    this.addCanvasToAllSlides()
    this.addCanvasHelpText()
    this.assembleToolbox()
    this.addToolboxToSlide()
    this.initEraserCursor()
    this.addToggleToolbox()
    this.resizeContent()

    this.addDrawing()
    this.addClearing()
    this.addErasing()

    // Scribble continuous updating
    slideshow.on('afterShowSlide', (slide) => {
      this.currFabric = this.fabrics[slide.getSlideIndex()]
      this.addToolboxToSlide()
      this.pathCache = []
    })
    slideshow.on(
      'beforeHideSlide',
      this.removeTransparentEraserPaths.bind(this)
    )
    window.addEventListener('resize', this.resizeContent.bind(this))
  }

  getVisibleSlide () {
    return document.querySelector('.remark-visible')
  }

  getVisibleSlideSize () {
    const slideSize = this.getVisibleSlide()
      .querySelector('.remark-slide-scaler')
      .getBoundingClientRect()
    return slideSize
  }

  getVisibleSlideScaleRatio () {
    const scaleRatio = this.getVisibleSlide().querySelector(
      '.remark-slide-scaler'
    ).style.transform
    return scaleRatio
  }

  getVisibleSlideCanvas () {
    return this.fabrics[slideshow.getCurrentSlideIndex()]
  }

  getVisibleSlideOuterContainer () {
    return this.getVisibleSlide().querySelector(
      '.xe-scribble'
    )
  }

  getVisibleSlideCanvasContainers () {
    return this.getVisibleSlide().querySelectorAll(
      '.xe-scribble__canvas__drawing'
    )
  }

  setPenColorCSSVariables (color) {
    const root = document.documentElement
    root.style.setProperty('--xe-scribble--button-draw-active-bg', color)
    root.style.setProperty(
      '--xe-scribble--button-draw-active-fg',
      this.pickContrastForegroundColor(color)
    )
    root.style.setProperty('--xe-scribble--pen-color', color)
  }

  createCanvas (id) {
    const slideSize = this.getVisibleSlideSize()

    const canvasDiv = document.createElement('div')
    canvasDiv.classList.add('xe-scribble')
    canvasDiv.style.width = slideSize.width
    canvasDiv.style.height = slideSize.height
    canvasDiv.style.left = slideSize.left + 'px'
    canvasDiv.style.top = slideSize.top + 'px'
    ;['mousedown', 'touchstart'].forEach((gesture) => {
      canvasDiv.addEventListener(gesture, this.mousedown.bind(this))
    })
    ;['mouseup', 'touchend'].forEach((gesture) => {
      canvasDiv.addEventListener(gesture, this.mouseup.bind(this))
    })

    const canvas = document.createElement('canvas')
    canvas.setAttribute('id', 'canvas' + id)
    canvas.classList.add('xe-scribble__canvas__drawing')
    canvas.setAttribute('width', slideSize.width)
    canvas.setAttribute('height', slideSize.height)

    canvasDiv.appendChild(canvas)

    return canvasDiv
  }

  addCanvasToAllSlides () {
    // Add <canvas> to slide container
    const nslides = slideshow.getSlideCount()
    let i = 0
    const slides = document.getElementsByClassName('remark-slide-container')
    slides.forEach((slide) => {
      if (i + 1 <= nslides) {
        const canvasDiv = this.createCanvas(i)
        slide.appendChild(canvasDiv)
        i += 1
      }
    })

    // Convert <canvas> to fabric.Canvas
    const allCanvases = document.querySelectorAll('.xe-scribble__canvas__drawing')
    this.fabrics = []
    allCanvases.forEach((el, index) => {
      this.fabrics[index] = new fabric.Canvas(el.id, {
        isDrawingMode: false,
        containerClass: 'xe-scribble__canvas'
      })
    })
    this.currFabric = this.fabrics[slideshow.getCurrentSlideIndex()]
  }

  resizeContent () {
    const scalerSize = document
      .querySelector('.remark-visible .remark-slide-scaler')
      .getBoundingClientRect()

    // Resize canvas container
    const outerContainers = document.querySelectorAll(
      '.xe-scribble'
    )
    outerContainers.forEach((div) => {
      div.style.width = scalerSize.width + 'px'
      div.style.height = scalerSize.height + 'px'
      div.style.left = scalerSize.left + 'px'
      div.style.top = scalerSize.top + 'px'
    })

    const scaleRatio = parseFloat(
      this.getVisibleSlideScaleRatio().match('\\d+.\\d+')
    )

    // Resize canvas itself
    this.fabrics.forEach((fab) => {
      fab.setWidth(scalerSize.width)
      fab.setHeight(scalerSize.height)
      fab.setZoom(scaleRatio)
    })

    // Reposition toolbox outside slides if there is extra space
    if ((window.innerWidth - scalerSize.width) / 2 >= 42) {
      this.toolBox.style.right = '-40px'
    } else {
      this.toolBox.style.right = '10px'
    }
  }

  createButton (id, name, title) {
    const btn = document.createElement('button')
    btn.classList.add('xe-scribble__button', 'xe-scribble__button__' + id)
    btn.innerHTML = this.svgs[name]
    btn.title = title || (name.slice(0, 1).toUpperCase() + name.slice(1))
    return btn
  }

  createColorPicker () {
    const colorPicker = document.createElement('input')
    colorPicker.setAttribute('id', 'xe-scribble__colorPicker')
    colorPicker.classList.add('xe-scribble__button')
    colorPicker.setAttribute('type', 'color')
    colorPicker.setAttribute('value', this.currColor)
    colorPicker.title = 'Choose Pen Color'
    return colorPicker
  }

  createToolbox () {
    this.toolBox = document.createElement('div')
    this.toolBox.classList = 'xe-scribble__tools'
  }

  rgbColorToHex (color) {
    // https://haacked.com/archive/2009/12/29/convert-rgb-to-hex.aspx/
    if (color.substr(0, 1) === '#') {
      return color
    }
    const digits = /rgb\((\d+),\s*(\d+),\s*(\d+)/.exec(color)

    const red = parseInt(digits[1])
    const green = parseInt(digits[2])
    const blue = parseInt(digits[3])

    const rgb = blue | (green << 8) | (red << 16)
    return '#' + rgb.toString(16).padStart(6, '0')
  }

  pickContrastForegroundColor (color, light, dark, threshold) {
    color = this.rgbColorToHex(color)

    // https://stackoverflow.com/a/41491220/2022615
    light = light || '#FFFFFF'
    dark = dark || '#000000'
    threshold = threshold || 145
    color = (color.charAt(0) === '#') ? color.substring(1, 7) : color
    const r = parseInt(color.substring(0, 2), 16) // hexToR
    const g = parseInt(color.substring(2, 4), 16) // hexToG
    const b = parseInt(color.substring(4, 6), 16) // hexToB

    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    function slideshowResize () {
      window.dispatchEvent(new Event('resize'))
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        slideshow.pause()
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

(function () {

      window.addEventListener('load', completed)
    }
  }

  ready(makeEditable)

  function makeEditable () {
    const docId = JSON.parse(
      document.getElementById('xaringanExtra-editable-docid').textContent
    )
    docId.id = 'editable_' + docId.id

    const blockEvents = ev => ev.stopPropagation()
    const getKey = el => Array.from(el.classList).filter(c => c.match('key'))[0]
    const html2json = el => window.himalaya.parse(el.innerHTML)
    const json2html = json => window.himalaya.stringify(json)

    function storeElement (el) {
      let stored = Cookies.get(docId.id)
      stored = stored ? JSON.parse(stored) : {}
      const key = getKey(el)
      if (!key) return
      stored[key] = html2json(el)
      Cookies.set(docId.id, JSON.stringify(stored), { expires: docId.expires, sameSite: 'None', secure: true })
    }

    function updateElement (el) {
      const key = getKey(el)
      if (!key) return
      let stored = Cookies.get(docId.id)
      if (!stored) return
      stored = JSON.parse(stored)
      if (!Object.keys(stored).includes(key)) return
      el.innerHTML = json2html(stored[key])
    }

    function setIsEditingClass () {
      document.body.classList.add('xe-editable_is-editing')
    }

    function removeIsEditingClass () {
      document.body.classList.remove('xe-editable_is-editing')
    }

    window.editable = {
      clearCookies () {
        Cookies.remove(docId.id)
      },
      clearCookiesAll () {
        Object.keys(Cookies.get())
          .filter(key => key.match(/^editable_/))
          .forEach(key => Cookies.remove(key))
      }
    }

    const editables = document.querySelectorAll('.can-edit')
    if (!editables.length) return

    editables.forEach(el => {
      el.setAttribute('contenteditable', true)
      el.setAttribute('autocomplete', 'off')
      el.setAttribute('autocorrect', 'off')
      el.setAttribute('spellcheck', false)

      el.addEventListener('focus', function () {

- Kaplan-Meier

$$ S(t) = \prod _{j:t_j\leq1}(1-\frac{d_j}{n_j})$$

donde `\(t_j\)` son los tiempos hasta el tiempo de inter√©s `\(j\)`; `\(d_j\)` denota el n√∫mero de eventos en el tiempo `\(j\)`, `\(n_j\)` indica el n√∫mero de personas en riesgo en el tiempo y que no experiment√≥ el evento hasta jsuto antes del tiempo `\(j\)`


- Ajuste indirecto


`$$\frac{\sum_{i}\,x_{\,Ai\,}\,}{\sum \left[ M_i \times n_{\,Ai\,} \right]}$$`

donde `\(n_{Ai}\)` son el n√∫mero de muertes observadas en la subpoblaci√≥n, `\(x_{Ai}\)` son las muertes observadas, `\(M_i\)` es la tasa de mortalidad de la poblaci√≥n de referencia.

- Modelo de regresi√≥n de riesgos proporcionales de Cox

$$ h(t)= h_0(t)e^{\beta_1 x_1+\beta_2x_2+\dots+\beta_p x_p }$$

donde `\(h_0(t)\)` son los riesgos basales (tasas basales), no param√©tricos; predictores lineales `\(x_p\)` (donde `\(\beta_p\)` alude a cualquier par√°metro), param√©tricos en escala log, por lo que act√∫an de forma multiplicativa sobre los riesgos basales.

- Criterio de akaike

$$ AIC = -2* \log(verosimilitud)+2(p+k)$$
donde `\(p\)` y `\(k\)` son el n√∫mero de par√°metros y coeficientes, respectivamente

- Suseso secundario: muerte tras resultar readmitidos `\(D_{M[S]}(t)\)`
